void fe_sq::thread_hdltv_gen() {
    const char* dump_tv = std::getenv("AP_WRITE_TV");
    if (!(dump_tv && string(dump_tv) == "on")) return;

    wait();

    mHdltvinHandle << "[ " << endl;
    mHdltvoutHandle << "[ " << endl;
    int ap_cycleNo = 0;
    while (1) {
        wait();
        const char* mComma = ap_cycleNo == 0 ? " " : ", " ;
        mHdltvinHandle << mComma << "{"  <<  " \"ap_rst\" :  \"" << ap_rst.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"ap_start\" :  \"" << ap_start.read() << "\" ";
        mHdltvoutHandle << mComma << "{"  <<  " \"ap_done\" :  \"" << ap_done.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"ap_idle\" :  \"" << ap_idle.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"ap_ready\" :  \"" << ap_ready.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"h_address0\" :  \"" << h_address0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"h_ce0\" :  \"" << h_ce0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"h_we0\" :  \"" << h_we0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"h_d0\" :  \"" << h_d0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"h_address1\" :  \"" << h_address1.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"h_ce1\" :  \"" << h_ce1.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"h_we1\" :  \"" << h_we1.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"h_d1\" :  \"" << h_d1.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"f_address0\" :  \"" << f_address0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"f_ce0\" :  \"" << f_ce0.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"f_q0\" :  \"" << f_q0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"f_address1\" :  \"" << f_address1.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"f_ce1\" :  \"" << f_ce1.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"f_q1\" :  \"" << f_q1.read() << "\" ";
        mHdltvinHandle << "}" << std::endl;
        mHdltvoutHandle << "}" << std::endl;
        ap_cycleNo++;
    }
}

